const reactMinifiedRegexp = /Minified React error #\d+;/i

function getPopSize(ex: Error & { framesToPop?: number }): number {
    if (ex) {
        if (typeof ex.framesToPop === 'number') {
            return ex.framesToPop
        }

        if (reactMinifiedRegexp.test(ex.message)) {
            return 1
